import React from "react";
import Header from "./components/Header/Header";
import Intro from "./components/Intro/Intro";
import MenuList from "./components/Menu/MenuList";
import menu from './dummy-meals';
const foodItems = [
  {
    id: 'm1',
    name: 'Glowing Quartz Bricks',
    description: 'Edible, light-emitting stones',
    price: '$29.99',
  }
];

function App() {
  return (
    <React.Fragment>
      <Header/>
      <Intro/>
      <MenuList title='Food' menuList={foodItems}/>
    </React.Fragment>
  );
}

export default App;
